import React, { Component } from 'react';
// import Navbar from 'react-bootstrap/Navbar';
// import NavDropdown from 'react-bootstrap/NavDropdown';
// import Form from 'react-bootstrap/Form';
// import FormControl from 'react-bootstrap/FormControl';
// import Button from 'react-bootstrap/Button';
// import Nav from 'react-bootstrap/Nav';
import {Nav,Navbar,NavDropdown,Form,FormControl,Button} from 'react-bootstrap'


class Navigation extends Component {
    render() {
        return (
            <Navbar bg="light" expand="lg">
                <Navbar.Brand href="#home">Family Archive</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <Nav.Link href="#home">Home</Nav.Link>
                        <NavDropdown title="Browse" id="basic-nav-dropdown">
                            <NavDropdown.Item href="#collections">Collections</NavDropdown.Item>
                            <NavDropdown.Item href="#actions">People</NavDropdown.Item>
                        </NavDropdown>
                    </Nav>
                    <NavDropdown title="Project" id="projects">
                        <NavDropdown.Item href="#project/1">Project1</NavDropdown.Item>
                        <NavDropdown.Item href="#project/2">Project2</NavDropdown.Item>
                        <NavDropdown.Divider />

                    </NavDropdown>
                    <Form inline>
                        <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                        <Button variant="outline-success">Search</Button>
                    </Form>
                </Navbar.Collapse>
            </Navbar>
        )
    }
}

export default Navigation
